import React from 'react';

class Title extends React.Component {
  render() {
    const { headline } = this.props;
    const { missions } = this.props;
    return (
      <div>

        <h2>
          {headline}
        </h2>
        <h2>
          {missions}
        </h2>
      </div>
    );
  }
}

export default Title;
